import React from 'react';
import Button from '@material-ui/core/Button';
const TodoList = () =>{
  return(
   <>
    <div className="main_div">
        <div className="center_div">
        <br/>
        <h1>Todo List</h1>
        <br/>
        <input type="text" placeholder="Add an item"/>
        </div>
    </div>
   </>
  );
}

export default TodoList;
